import React, { useEffect, useState } from "react";
import { Form, Button, Image, Spinner } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

//Importaciones de componentes
import TabMenuPaqueteria from "../../components/Paqueteria/TabMenuPaqueteria";
import BannerHome from "../../components/BannerHome";

export default function Home() {
    const navigate = useNavigate();

    const [books, setBooks] = useState([]);

    const [loading, setLoading] = useState(false);

    useEffect(() => {
        setLoading(true);
        fetch('http://localhost:4000/test/libros')
            .then(response => response.json())
            .then((data) => {
                setBooks(data);
                setLoading(false);
            })
            .catch((e) => {
                console.log(e);
                setLoading(false);
            })
    }, []);

    return (
        <>
            <BannerHome />
            <TabMenuPaqueteria />
            <div style={{ backgroundColor: "#ebebeb", height: "40vh" , display: "flex"}}>
                <form style={{ width: "20%" , height: "10%", margin: "1%", display: "flex"}}>
                    <label for="texto" style={{width: "50%"}}>Buscar: </label>
                    <input type="text" name="texto" placeholder="   ID de pedido"></input>
                <Button variant="light">Buscar</Button>
            </form>
            </div>
        </>
    )
}
